import React from "react";
import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import ContactImg from "../images/6.jg"

export default function Contact() {
    return (
      <div className="contact">
        <Navbar />
        <Hero
          className="hero-mid"
          img={SeviceImg}
          title="Service"
          btnClassName="hidden"
        />
      </div>
    );
  }
